import styled from "styled-components";
import { Container } from "../../GlobalStyles";

export const ContactContainer = styled.section`
  min-height: 100vh;
`

export const Wrapper = styled(Container)`
  display: flex;
  flex-direction: column;
  <aliogn-items></aliogn-items>
`
